from string import ascii_lowercase

inp = """"""


def react(polymer):
    i = 0
    j = 1
    while True:
        if polymer[i] != polymer[j] and (polymer[i].upper() == polymer[j].upper()):
            if i > 0:
                if j < (len(polymer) - 1):
                    i, j = i-1, j+1
                else:
                    break
            else:
                polymer = polymer[j+1:]
                i, j = 0, 1
        else:
            polymer = polymer[:i+1] + polymer[j:]
            i, j = i+1, i + 2
            if j >= len(polymer):
                break
    return polymer


polymer = react(inp)

counter = dict()

for letter in ascii_lowercase:
    new_polymer = polymer.replace(letter, '')
    new_polymer = new_polymer.replace(letter.upper(), '')
    new_polymer = react(new_polymer)
    counter[letter] = len(new_polymer)

print(min(counter.items(), key=lambda item: item[1]))
